import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
constructor() {
  super();
}

  render() {
    return (
      <div className="App">
        <header className="App-header">
        <h1>React.JS</h1>
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hi Steve
          </p>
          <button>Change Name</button>
        </header>
      </div>
    );
  }
}

export default App;
